import { Route, Routes } from 'react-router-dom';

import { Data } from './Data';
import { Home } from './Home';

function App() {
  return (
    <Routes>
      <Route exact path="/" element={<Home />} />
      <Route exact path="/data" element={<Data />} />
    </Routes>
  );
}

export default App;
